import Share from "../../components/Share/Share";
import Post from "../../components/Post/Post";

export default function Feed() {
    return (
        <div className="feed">
            <Share/>
            <Post/>
            <Post/>
            <Post/>
            <Post/>
            <Post/>
        </div>
    )
}
